import Carousel from '../components/Carousel'
import React from 'react'
import Productos from '../components/productos'

function Principal(){
    const estilos = {
        textAlign: "center"
    }
    return (
        <div className = "container-fluid">
            <Carousel />
            <h1 style = {estilos}>Catalogo</h1>
            <Productos />  
        </div>
        )
}

export default Principal
